import './App.css';
import Quiz  from './components/Quizform'
import Navbar from './components/Navbar';
import Login from './components/Login.tsx';
import Register from './components/Register.tsx';
import {useState} from "react"
import Home from './components/home.tsx';
function App() {
  const [diplay, setDisplay] = useState({
    home:true,
    new:false,
    register:false,
    login:false,
  })
  function displayHome(){
    setDisplay({
      home:true,
      new:false,
      register:false,
      login:false,
    })
  }
  function displayNew(){
    setDisplay({
      home:false,
      new:true,
      register:false,
      login:false,
    })
  }
  function displayLogin(){
    setDisplay({
      home:false,
      new:false,
      register:false,
      login:true,
    })
  }
  function displayRegister(){
    setDisplay({
      home:false,
      new:false,
      register:true,
      login:false,
    })
  }
  return (
    <>
      <Navbar 
        homeDisplay={displayHome} 
        newDisplay={displayNew} 
        loginDisplay={displayLogin} 
        registerDisplay={displayRegister}
      />
      {diplay.home && (
        <Home />
      )}
      {diplay.new && (
        <Quiz />
      )}
      {diplay.login && (
        <Login />
      )}
      {diplay.register && (
        <Register />
      )}
    </>
  );
}

export default App;
